import { useContext, useEffect, useState } from "react";
import Category from "../components/Common-components/CategoryIphones";
import SpecialHeader from "../components/Common-components/SpecialHeader";
import ProductCard from "../components/ProductCard";
import Skeleton from "../components/Skeleton/Skeleton";
import NotFoundPage from "../components/Common-components/NotFoundPage";
import { useDispatch, useSelector } from "react-redux";
import { setToken, setPage, selectPage } from "../store/SpecificationSlice";
import { useGetAllProductsQuery } from "../store/api";

function Iphones(properties) {
  const productToken = "iPhone";
  const [page, setPage] = useState(0);
  const dispatch = useDispatch();

  // useEffect(() => {
  //   // dispatch(setToken(productToken));
  //   // dispatch(setPage(page));
  //   console.log("Token set to:" + productToken);
  // }, [productToken, page]);

  const { data, error, isLoading } = useGetAllProductsQuery(
    {
      page: page, 
      token: productToken
    },
    { refetchOnMountOrArgChange: true }
  );

  if (!isLoading) {
    console.log("Page:" + page);
    console.log({ data, error });
  }
  // useEffect(() => {
  //   properties.setToken(productToken);
  // }, [productToken, properties.setToken]);

  console.log("Data:" + properties.data);

  return (
    <>
      <SpecialHeader></SpecialHeader>
      <div className="mainPhoneContainer">
        <div className="phoneContainer">
          <div className="categoryIphones">
            <Category></Category>
          </div>
          <div className="iphoneSection">
            <div className="iphoneContainer">
              {isLoading ? (
                [...new Array(6)].map((_, index) => (
                  <Skeleton key={index}></Skeleton>
                ))
              ) : data != null ? (
                data.content.map((obj) => (
                  <ProductCard
                    key={obj.id}
                    {...obj}
                    isAppleWatch={productToken == "Applewatch"}
                  ></ProductCard>
                ))
              ) : (
                <NotFoundPage></NotFoundPage>
              )}
            </div>
            <div className="pagination">
              {!isLoading && data.totalPages !== 0
                ? [...new Array(data.totalPages)].map((obj, index) => (
                    <button
                      key={index}
                      // onClick={() => dispatch(setPage(index))}
                      onClick={() => setPage(index)}
                    >
                      {index + 1}
                    </button>
                  ))
                : null}
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Iphones;
